import React from 'react'

const Image = () => {
  return (
    <div>
      
      <div className="col-md-5 mx-5">
                    <img src="images/loginanimated.gif" className="img-fluid animated fly-in" alt='login' style={{ height: "300px", width: "400px" }} />
       </div>

    </div>
  )
}

export default Image
